    false,nt"url": null,nt"notes": "The Malheur Lake is the largest fresh water
    marsh in western North America. The Silvies River from the Blue Mountains and the
    Donner und Blitzen River from the Steens Mountain find their final destination in
    the marsh. Malheur marsh has been important to wildlife, particularly migratory
    birds, since before recorded history of the area. Waterfowl have nested and raised
    their young on the lakes as well as resting during migration by the hundreds of
    thousands. Particularly famous are the nesting colonies of water and marsh birds.
    These included pelicans, cormorants, herons, egrets, ibis and terns. Nesting colonies
    of egrets were so famous that plume hunters in the late 1800's nearly eliminated
    them. In reaction to this, President Theodore Roosevelt in 1908 gave protective
    status as the Lake Malheur Reservation. Since then management of the marsh has been
    as a refuge. However, management has generally been limited to protection. Little
    physical manipulation has occurred, leaving the marsh in a near natural state.",nt"owner_org":
